Tweet text:
 like any seed far from its just terrain,
if fortune clashes with its inborn power,
one's nature yields a paltry crop of grain

 if the one on the water (the crocodile) opens his mouth,
if he shakes with his two arms,
I shall cause the earth to go down into the primeval water,
&amp; the south will be the north,
&amp; the earth will turn round https://t.co/4Um33p0QrX

 never may my woes be relieved, since pity is fled;
and tears and sighs and groans my weary days
of all joys have deprived.
